	module.exports = "<p>Hi, my name is Julien, I live in Paris, France and code for a while with a passion for web technologies but also data, visualization...</p>\n<p>On this blog, I will try to share with you my interest and some examples, tutorials or stories.</p>\n<pre><code class=\"lang-javascript\">alert(&#39;hello world&#39;);\n</code></pre>\n<p><img src=\"/images/posts/pexels-photo.jpg\" alt=\"Just for fun\"></p>\n";

