	module.exports = "<p>Mozilla documentation is the best but here I share some of new es6 sugar syntaxes features you may know or not :) To my opinion it really gives a less verbose and intuitive code if we all embrace es6.</p>\n<p>I also share a small cover of very intuitive <a href=\"https://github.com/gaearon\">Dan Abramov</a> redux <a href=\"https://egghead.io/instructors/dan-abramov\">tutorial</a>. When <a href=\"https://facebook.github.io/flux/\">Flux</a> appeared, I choosed <a href=\"https://github.com/goatslacker/alt\">Alt</a> implementation, many utils were into the box as store listening component, action listeners...it is really a great tool.</p>\n<p>Then redux is born and so many were enthousiasts about it, I had to test it too.</p>\n<h2 id=\"es6\">ES6</h2>\n<p>Here some of the best changes we need to know. Most of them you may know and me too but read it again is always useful, and a lot are missing there....</p>\n<p>Best online javascript ES6 book according to me is <a href=\"https://leanpub.com/understandinges6/read\">here</a></p>\n<h3 id=\"arrow-function\">Arrow function</h3>\n<pre><code class=\"lang-javascript\">function double(value) {\n    return value &lt;&lt; 1;\n}\n</code></pre>\n<p>becomes</p>\n<pre><code class=\"lang-javascript\">const double = (value) =&gt; {\n    return value &lt;&lt; 1;\n}\n</code></pre>\n<p>{ } can be removed</p>\n<pre><code class=\"lang-javascript\">// because of just a single statement\nconst double = (value) =&gt; value &lt;&lt; 1;\n</code></pre>\n<p>() can be removed</p>\n<pre><code class=\"lang-javascript\">// because of just a single parameter\nconst double = value =&gt; value &lt;&lt; 1;\n</code></pre>\n<h3 id=\"default-parameter-value\">Default parameter value</h3>\n<p>We often see that type of notation in our code.</p>\n<pre><code class=\"lang-javascript\">function double(value) {\n    value = value || 1;\n    return value &lt;&lt; 1;\n}\n</code></pre>\n<p>The Logical OR || operator will return its second operand if the first one is falsy.</p>\n<p>Falsy values are: 0, null, undefined, the empty string (&quot;&quot;), NaN, and of course false.</p>\n<p>Indeed, if we coerce this kind of value to boolean with (!!) operator we got.</p>\n<pre><code class=\"lang-javascript\">!!0 === false\n!!null === false\n!!undefined === false\n// ....\n!!0 === !!null === !!undefined == !!&#39;&#39; === !!NaN === !!false\n</code></pre>\n<p>so previous example with es6 becomes</p>\n<pre><code class=\"lang-javascript\">const double = (value = 1) =&gt; {\n    return value &lt;&lt; 1;\n};\n\nconsole.log(double());  // 2\nconsole.log(double(3)); // 6\n</code></pre>\n<h3 id=\"rest-parameter\">Rest parameter</h3>\n<p>Arguments parameter object is an old story now, welcome to new world, not a real Array, slice conversion etc...forget it.</p>\n<pre><code class=\"lang-javascript\">const play = (...args) =&gt; {\n  // !!! arguments has never been an array...\n  //arguments.push(&#39;not possible&#39;);\n\n  // this is possible now\n  args.push(4); [1, 2, 3, 4]\n  console.log(args);\n};\n\nplay(1,2,3);\n</code></pre>\n<h3 id=\"spread-operator\">Spread operator</h3>\n<p>Apply, call methods must be an old story for you too now, we live in 2015(6) hey !</p>\n<pre><code class=\"lang-javascript\">function myFunction(x, y, z) {\n  var t = [x,y,z];\n  console.log(t); // [0, 1, 2]\n}\nvar args = [0, 1, 2];\nmyFunction(...args);\n</code></pre>\n<p>Or with array spread operator</p>\n<pre><code class=\"lang-javascript\">var ages = [18,19,20];\n\nfunction myFunction(x, y, z) {\n  var t = [x,y,z, ...ages];\n  console.log(t); // [0, 1, 2, 18, 19, 20]\n}\nvar args = [0, 1, 2];\nmyFunction(...args);\n</code></pre>\n<p>Another exemple of refactoring with the use of slice and concat methods.</p>\n<pre><code class=\"lang-javascript\">var list = [1, 2, 3, 4];\n\n// let remove third index with an immutable approach,\n// we want new array and not modifying existing one.\n\nlist = list.slice(0, 2).concat(list.slice(3));\n\nconsole.log(list); // [1, 2, 4]\n</code></pre>\n<p>well, it is nice but es6 is your friend now.</p>\n<pre><code class=\"lang-javascript\">var list = [1, 2, 3, 4];\n\nlist = [...list.slice(0, 2), ...list.slice(3)];\n\nconsole.log(list); // [1, 2, 4]\n</code></pre>\n<p>also note that with this spread operator, you can insert whatever you want inside the new array.</p>\n<pre><code class=\"lang-javascript\">list = [&#39;before&#39;, ...list.slice(0, 2), &#39;middle&#39;, ...list.slice(3), &#39;after&#39;];\n</code></pre>\n<h3 id=\"object-assign\">Object assign</h3>\n<p>Avoiding mutating object is one of the key to avoid side effect in your application. Idea behind is whatever you may change on an object, property, method...please after modifying it, not just return it but return a new object instead.</p>\n<pre><code class=\"lang-javascript\">const upperCaseName = (person) =&gt; {\n  return {\n    name : person.name.toUpperCase(),\n    age : person.age,\n    sex : &#39;F&#39;, //\n  };\n}\n</code></pre>\n<p>But as you can see it is painless and we may forget some fields too.</p>\n<p>One solution is to use Object.assign() es6 method <a href=\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Object/assign\">Object.assign()</a></p>\n<pre><code class=\"lang-javascript\">const upperCaseName = (person) =&gt; {\n  return Object.assign({}, person, {\n    name : person.name.toUpperCase()\n  });\n}\n</code></pre>\n<p>NOTE: it looks like you may use in future this spread solution too :)</p>\n<pre><code class=\"lang-javascript\">const upperCaseName = (person) =&gt; {\n  return {\n    ...person,\n    name : person.name.toUpperCase()\n  };\n}\n</code></pre>\n<h3 id=\"shorthand-properties-and-methods\">Shorthand Properties and Methods</h3>\n<p>Before</p>\n<pre><code class=\"lang-javascript\">var person = function(name, age) {\n  return {\n    name: name,\n    age: age,\n    sayMyDetails: function() {\n      console.log(&#39;my name is &#39; + this.name + &#39; and I am &#39; + this.age);\n    }\n  };\n};\n\nvar p = person(&#39;julien&#39;, 36);\np.sayMyDetails(); // my name is julien\n</code></pre>\n<p>Yes, but very verbose, look at this way of doing instead</p>\n<pre><code class=\"lang-javascript\">const person = (name, age) =&gt; {\n  return {\n    name,\n    age,\n    sayMyDetails() {\n      console.log(&#39;my name is &#39; + this.name + &#39; and I am &#39; + this.age);\n    }\n  };\n};\n\nconst julien = person(&#39;julien&#39;, 36);\njulien.sayMyDetails();\n</code></pre>\n<h3 id=\"destructuring-import\">Destructuring import</h3>\n<pre><code class=\"lang-javascript\">var module = require(&#39;module&#39;);\n\nconst myFunc = module.myFunc;\n\n// call my module function\n....\nmyFunc();\n</code></pre>\n<p>becomes</p>\n<pre><code class=\"lang-javascript\">import {myFunc} from &#39;module&#39;;\n....\nmyFunc();\n</code></pre>\n<h2 id=\"react\">React</h2>\n<h3 id=\"recap\">Recap</h3>\n<p><a href=\"https://facebook.github.io/react/docs/glossary.html#react-elements\">ReactElement</a> ReactElement is not DOM element. It <em>describes</em> DOM element but it&#39;s not a native object at all. It&#39;s a regular JS object that happens to describe a DOM element.</p>\n<p><a href=\"https://facebook.github.io/react/docs/glossary.html#react-components\">ReactComponent</a> gives abilitity to create encapsulations with embedded state. They can be written as functions, or classes (React.Component).</p>\n<h3 id=\"react-component-as-a-function\">React component as a function</h3>\n<p><a href=\"https://facebook.github.io/react/blog/2015/10/07/react-v0.14.html#stateless-functional-components\">Functional components</a> is a technical distinction. You can put anything in a functional component, including behavior. It is up to you.</p>\n<p>Facebook introduced it to facilitate creation of stateless component.</p>\n<pre><code class=\"lang-javascript\">const Text = ({name, onClick, children}) =&gt; &lt;p onClick={onClick}&gt;{children} {name}&lt;/p&gt;;\n\nconst someProps = {\n  name: julien,\n  age: 36,\n  onClick: () =&gt; {\n    console.log(&#39;click&#39;);\n  }\n};\n\nReactDOM.render(document.body, &lt;Text {...someProps}&gt;Hello World&lt;/Text&gt;);\n\n//Hello world julien\n</code></pre>\n<p>As you can see, no declarative render() method here, you do not need it explicitly, React will render it for you.</p>\n<p>Best practice is to avoid using Component classes and replace it with functional component instead when you can :)</p>\n<h3 id=\"containers-and-presentation-components\">Containers and Presentation components</h3>\n<p>According to Dan</p>\n<p>&quot;\n&#39;Presentational&#39; components is not a real term. It&#39;s just a convention I&#39;m using. There&#39;s no such thing in React as a &quot;presentational component&quot;—it&#39;s just how I like to call components with no behavior. They <em>happen</em> to be convenient to describe using functional components, but these two terms are not equivalent at all.</p>\n<p>A presentational component technically can be written as a class, and a container component can be written as a function. So be careful not to equate &quot;presentational&quot; with &quot;functional&quot; even though most components you see in my course are both.&#39;</p>\n<p>Container component are on top of you presentation only containers, your logic and behaviour is expressed there.</p>\n<p>You may create them when you feel a presentation component has too much to do, extract it a container component to load your data and express behaviour.</p>\n<p>Only a container component might need to be sticked to your flux store, meaning they will subscribe to your store updates and will be responsible to re render sub components when necessary.</p>\n<p>Container component roles could be summarized by:</p>\n<ul>\n<li>read data from store</li>\n<li>subscribe to the store</li>\n<li>dispatch actions on the store</li>\n</ul>\n<h3 id=\"passing-via-prop-vs-passing-via-context\">Passing via Prop vs Passing via Context</h3>\n<p>After a bunch of refactoring, your component code would certainly need to pass down to the tree many properties, and it is quite annoying to see such property repeated. A solution exists to propagate a property with the use of a specific container and childContext method.</p>\n<p>In redux tutorial, Dan is giving an example where a lot of your component need a reference to the store.</p>\n<pre><code class=\"lang-javascript\">const {createStore} = Redux;\n\nconst reducer = (state = [], action) =&gt; {};\n\nconst MyApp = ({store}) =&gt; {\n  &lt;div&gt;\n    &lt;Component store={store} /&gt;\n    &lt;Component store={store} /&gt;\n    &lt;Component store={store} /&gt;\n  &lt;/div&gt;\n}\n\nReactDom.render(\n    &lt;MyApp store={createStore(reducer)},\n    document.getElementById(&#39;root&#39;)\n)\n</code></pre>\n<p>That is quite annoying, why not delegate this a wrapper component with use of <a href=\"https://facebook.github.io/react/docs/context.html\">context</a>:</p>\n<pre><code class=\"lang-javascript\">const {createStore} = Redux;\n\n// responsible to put store in context\nclass Provider extends Component {\n  getChildContext() {\n    return {\n      store: this.props.store\n    }\n  }\n\n  render() {\n    // just render whatever you pass to it\n    return this.props.children;\n  }\n}\n\nProvider.childContextTypes = {\n  store: React.PropTypes.object\n};\n\nconst MyApp = ({store}) =&gt; {\n  &lt;Provider store={store}&gt;\n    &lt;Component /&gt;\n    &lt;Component /&gt;\n    &lt;Component /&gt;\n  &lt;/div&gt;\n}\n\nReactDom.render(\n    &lt;Provider store={createStore(reducer)}&gt;\n      &lt;MyApp&gt;\n    &lt;/Provider&gt;,\n    document.getElementById(&#39;root&#39;)\n)\n</code></pre>\n<p>Provider is available in ReactRedux library, do not reinvent the wheel.</p>\n<pre><code class=\"lang-javascript\">const { Provider } = ReactRedux;\n// import { Provider } from &#39;react-redux&#39;;\n....\n</code></pre>\n<h3 id=\"advanced-pattern-\">Advanced &quot;pattern&quot;</h3>\n<p>Redux exposes a reducer composition method and here I propose to recap how it works briefly.</p>\n<p>In your application you may deal with reducers managing plain objects most of the time.</p>\n<p>Also you may decide to split your logic into many reducers instead of only one, here comes composition.</p>\n<pre><code class=\"lang-javascript\">(state = {}, action) {\n  return state;\n}\n</code></pre>\n<p><em>Example</em></p>\n<p>We want to manage a shopping basket state with 2 main data exposed in 2 fields &#39;basket&#39; and &#39;current&#39; :</p>\n<pre><code class=\"lang-javascript\">{\n  &#39;basket&#39;: [], // list of selected items\n  &#39;current&#39;: {} // current visited item\n}\n</code></pre>\n<p>Redux actions would be:</p>\n<ul>\n<li>ADD_TO_BASKET / REMOVE_FROM_BASKET</li>\n<li>SET_CURRENT / UNSET_CURRENT</li>\n</ul>\n<p>We may have 2 reducers methods and want to combine it into one reducer:</p>\n<pre><code class=\"lang-javascript\">const basket = (state = [], action) =&gt; {\n  console.log(&#39;basket reducer&#39;);\n  // state.basket.pushPull()...\n};\n\nconst current = (state = {}, action) =&gt; {\n  console.log(&#39;current reducer&#39;);\n  // state.current.SetUnsetItem()...\n}\n\n// idea is to create a &quot;dual&quot; reducer this way now\nconst reducer = {\n  basket: basket,\n  current: current\n}\n\n// later a call to reduce createStore\n// createStore(reducer);\n</code></pre>\n<p>Ok but normaly a reducer is a function waiting for a state and action parameters...and you show me plain object, your are kidding me ?\nproblem is this reducer has really not the good signature, is not a function...but just a plain JS object.</p>\n<p>Here is proposal Dan solution, create a function taking an object and generating a reducer function.</p>\n<p>When called, it will</p>\n<ul>\n<li>iterate over object properties</li>\n<li>pass state object to each of reducer function via reduce passing state to each of reducer</li>\n<li>well done I would say, nice idea</li>\n</ul>\n<p>See <a href=\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/Reduce\">reduce()</a> API</p>\n<pre><code class=\"lang-javascript\">const reducerCombinator = (reducers) =&gt; {\n  // we return a function\n  return (state = {}, action) =&gt; {\n    // that iterate over our object and apply reduce on it\n    return Object.keys(reducers).reduce(\n      // apply each object property function &quot;basket()&quot;/&quot;current()&quot;/....\n      // that modify state\n      // that will be passed as previousValue for the next reduce\n      (nextState, key) =&gt; {\n        nextState[key] = reducers[key](state[key], action);\n        return nextState;\n      },\n      {}\n    );\n  };\n};\n</code></pre>\n<p>Thank you Dan for helping me on rewriting some parts of this article.</p>\n<p>ES Fiddle <a href=\"http://www.es6fiddle.net/ii60qbhg/\">here</a></p>\n<p>React Fiddle <a href=\"https://jsfiddle.net/darul75/7j4ggkqh/\">here</a></p>\n";

