	module.exports = "<p>An attempt to explain what is an Higher-Order Component, why it is useful, why it is simple.</p>\n<p>You may think first at Higher Order Function and you are right, it comes from Functional Programming concept where I am not expert :) and is a great alternative to the use of Mixins in the world of React.</p>\n<h2 id=\"mixins\">Mixins</h2>\n<p>Before exploring what is an higher-order component (HOC), let&#39;s recap what are mixins.</p>\n<p>Usage of mixins allows to extend a target object with some new properties or behaviours.</p>\n<p>A popular mixin would be a logger :)</p>\n<pre><code class=\"lang-javascript\">// mixin\nconst Logger = {\n  debug(msg) {\n    console.log(msg);\n  },\n  error(err) {\n    console.log(err);\n  }\n};\n\n// and why not another useful one\nconst AnotherMixin = {\n  do() {\n  }\n};\n</code></pre>\n<p>Then developer team writes a scheduler service and need to use our logger mixin service.</p>\n<pre><code class=\"lang-javascript\">class Scheduler {\n  constructor(startDate) {\n    if (startDate == null) {\n      // logger call\n      this.onError(new Error(&#39;startDate has to be defined&#39;));\n      return Object.create(null);\n    }\n    this.startDate = startDate;\n  }\n\n  start() {\n    // logger call\n    this.debug(&#39;start&#39;);\n  }\n\n  onError(err) {\n    // logger call\n    this.error(err);\n  }\n}\n</code></pre>\n<p>See how we apply mixin on our service.</p>\n<pre><code class=\"lang-javascript\">Object.assign(Scheduler.prototype, Logger);\nObject.assign(Scheduler.prototype, AnotherMixin);\n\nnew Scheduler(new Date()).start();\nnew Scheduler(new Date()).start();\nconsole.log(new Scheduler(new Date()));\nnew Scheduler().start();\n</code></pre>\n<p>JSFiddle is <a href=\"http://www.es6fiddle.net/ij1ldc1u/\">here</a></p>\n<p>Here I just give a trivial example, but you could take a look for more details here:</p>\n<p><a href=\"https://addyosmani.com/resources/essentialjsdesignpatterns/book/#mixinpatternjavascript\">ref1</a>\n<a href=\"http://raganwald.com/2014/04/10/mixins-forwarding-delegation.html\">ref2</a>\n<a href=\"http://raganwald.com/2015/06/17/functional-mixins.html\">ref3</a></p>\n<h2 id=\"react-mixin\">React mixin</h2>\n<p>React <a href=\"https://facebook.github.io/react/docs/reusable-components.html#mixins\">mixins</a> gave us a way to enhance a component by sharing some common functionnalities with a guaranty that all of the component lifecycle methods would be called.</p>\n<p>But, by reading that kind of <a href=\"https://medium.com/@dan_abramov/mixins-are-dead-long-live-higher-order-components-94a0d2f9e750#.5nifnaw58\">article</a> that covers all aspects of mixins, you will understand why you should <em>avoid</em> using it today.</p>\n<p>You may also notice that warnings exist on Facebook React pages about <a href=\"https://facebook.github.io/react/docs/reusable-components.html#no-mixins\">mixin support</a>...in future distributions.</p>\n<h2 id=\"higher-order-component\">Higher-order component</h2>\n<p>Ok but what is an HOC ?</p>\n<p><strong>&quot;A higher-order component is just a function that takes an existing component and returns another component that wraps it.&quot;</strong></p>\n<p>When you hear about HOC, think about <strong>Composition</strong>.</p>\n<p>Idea behind is to encapsulate our component and give it functionality we want, like with mixin but by using composition instead.</p>\n<h2 id=\"code-pattern\">Code pattern</h2>\n<p>By looking at following <a href=\"https://gist.github.com/sebmarkbage/ef0bf1f338a7182b6775\">gist</a> by Sebastian Markbåge you may notice that what we need to do is just create a function that takes a component and return a component (wrapping input component), that is all.</p>\n<pre><code class=\"lang-javascript\">const HOC = (Component) =&gt; class extends React.Component {\n  constructor(props) {\n    super(props);\n  }\n  // do whatever you may want\n  render() {\n    // pass new properties to wrapped component\n    return &lt;Component {...this.props} {...this.state} /&gt;\n  }\n};\n</code></pre>\n<p>Note that <strong>returned component extends React.Component</strong> and does not inherits from passed component.</p>\n<h2 id=\"react-mixin-refactoring-example\">React Mixin Refactoring Example</h2>\n<p>Let&#39;s try to refactor Facebook <a href=\"https://facebook.github.io/react/docs/reusable-components.html#mixins\">mixin</a> example here with an High Order Component.</p>\n<h3 id=\"original-mixin-solution\">Original mixin solution</h3>\n<pre><code class=\"lang-javascript\">var SetIntervalMixin = {\n  componentWillMount: function() {\n    this.intervals = [];\n  },\n  setInterval: function() {\n    this.intervals.push(setInterval.apply(null, arguments));\n  },\n  componentWillUnmount: function() {\n    this.intervals.forEach(clearInterval);\n  }\n};\n\nvar TickTock = React.createClass({\n  mixins: [SetIntervalMixin], // Use the mixin\n  getInitialState: function() {\n    return {seconds: 0};\n  },\n  componentDidMount: function() {\n    this.setInterval(this.tick, 1000); // Call a method on the mixin\n  },\n  tick: function() {\n    this.setState({seconds: this.state.seconds + 1});\n  },\n  render: function() {\n    return (\n      &lt;p&gt;\n        React has been running for {this.state.seconds} seconds.\n      &lt;/p&gt;\n    );\n  }\n});\n</code></pre>\n<p>JSFiddle for this mixin is <a href=\"https://jsfiddle.net/darul75/1wzph748/\">here</a></p>\n<h3 id=\"hoc-solution\">HOC solution</h3>\n<p>All logic will be set into an HOC and wrapped component will be reduced to presentation only.</p>\n<p>High order component would store a state, trigger state changes by applying custom function on it before.</p>\n<p>In facebook example, our component do some stuff and repeat it on &#39;regular&#39; interval and this custom logic will be passed as argument to our HOC.</p>\n<pre><code class=\"lang-javascript\">// Component : the one to be wrapped\n// state : initial state of our component\n// intervalFn : arbitrary function modifying state\n\nconst HOC = (Component, state, intervalFn) =&gt; class extends React.Component {\n  constructor(props) {\n    super(props);\n    this.state = state;\n  }\n\n  componentWillMount() {\n    this.intervals = [];\n  }\n\n  componentWillUnmount() {\n    this.intervals.forEach(clearInterval);\n  }\n\n  componentDidMount() {\n    this.setInterval(this.tick.bind(this), 1000);\n  }\n\n  setInterval() {\n    this.intervals.push(setInterval.apply(null, arguments));\n  }\n\n  tick() {\n    this.setState(intervalFn(this.state));\n  }\n\n  render() {\n    return &lt;Component {...this.props} {...this.state} /&gt;\n  }\n};\n</code></pre>\n<p>Our tiny wrapped presentation component.</p>\n<pre><code class=\"lang-javascript\">class TickTock extends React.Component {\n  constructor(props) {\n    super(props);\n  }\n\n  render() {\n    return (\n        &lt;p&gt;\n          React has been running for {this.props.seconds} seconds.\n        &lt;/p&gt;\n    );\n  }\n}\n\nTickTock.propTypes = {\n  seconds: React.PropTypes.number.isRequired,\n}\n</code></pre>\n<p>Now let&#39;s see how we can glue all this together.</p>\n<p>First if you remember, our HOC factory function expect 3 arguments:</p>\n<p>1) component to be wrapped &quot;TickTock&quot;</p>\n<p>2) an arbitrary state object</p>\n<pre><code class=\"lang-javascript\">const state = {\n  seconds: 0\n};\n</code></pre>\n<p>3) an arbitraty function modifying this state object</p>\n<pre><code class=\"lang-javascript\">const intervalFn = (state) =&gt; {\n  return {seconds: state.seconds + 1};\n};\n</code></pre>\n<p>Final main result function could be</p>\n<pre><code class=\"lang-javascript\">const intervalFn = (state) =&gt; {\n  return {seconds: state.seconds + 1};\n};\n\nconst Wrapped = HOC(TickTock, { seconds: 0 }, intervalFn);\nconst Wrapped2 = HOC(TickTock, { seconds: 3 }, intervalFn);\nconst Wrapped3 = HOC(TickTock, { seconds: 6 }, intervalFn);\n\nReactDOM.render(\n  &lt;div&gt;\n    &lt;Wrapped /&gt;\n    &lt;Wrapped2 /&gt;\n    &lt;Wrapped3 /&gt;\n  &lt;/div&gt;,\n  document.getElementById(&#39;container&#39;)\n);\n</code></pre>\n<p>JSFiddle for this demo is <a href=\"https://jsfiddle.net/darul75/hwn8rn1r/\">here</a></p>\n<h2 id=\"conclusion\">Conclusion</h2>\n<p>HOC is an alternative to mixins that only rely on component composition.</p>\n<p><img src=\"/images/posts/higher.jpg\" alt=\"Just for fun\"></p>\n";

